import React from 'react';
import styled from "styled-components";
import Logo from "../header/images/logo.svg"
import Profile from "../header/images/profile.svg"
import Inventory from "../header/images/inventory.svg"
import Notifications from "../header/images/notifications.svg"
import Tracker from "../header/images/tracker.svg"
import Text from "../../theme/text";

const HeaderWrapper = styled.div`
  background-color: #320F0F;
  padding: 5px 15px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`;

const RowContainer = styled.div`
  display: flex;
  flex-direction: row;
`;

function Header() {
    return (
        <HeaderWrapper>
            <img src={Logo}/>
            <RowContainer>
                <RowContainer>
                    <div>
                        <img src={Tracker}/>
                    </div>
                    <Text fontWeight={800}>
                        Investment tracker
                    </Text>
                </RowContainer>
                <RowContainer>
                    <div>

                    </div>
                    <img src={Inventory}/>
                    <Text fontWeight={800}>
                        Inventory
                    </Text>
                </RowContainer>
            </RowContainer>
            <RowContainer>
                <RowContainer>
                    <img src={Notifications}/>
                    <Text fontWeight={800}>
                        Notifications
                    </Text>
                </RowContainer>
                <RowContainer>
                    <img src={Profile}/>
                    <Text fontWeight={800}>
                        Hello, uz1mane!
                    </Text>
                </RowContainer>
            </RowContainer>
        </HeaderWrapper>
    );
}

export default Header;
